import React, { Component } from 'react';
import { ImageWord } from './ImageWord';

export class HomeUser extends Component {

    render() {
        
        console.log('Lodding Image');
        return <div>
            {ImageWord.map(({name, birthday, id}) => (<p key={id}>{name}'s birthday is on {birthday}</p>))}
        </div>
    }
}
